export default class ChooseCar extends Component {
  render() {
    return (
      <div className='container-fluid'>
        <div className='row'>
          <div className='col-7'>
            <img src={require('./Asset/CarBasic/products/')} alt='black'></img>
          </div>
          <div className='col-5'>
            Doan
          </div>
        </div>
      </div>
    )
  }
}
